function Pokemon(props) {
  const itemTypes = props.dataItem.types.map((type, index) => {
    return <li key={index}>{type}</li>;
  });
  return (
    <div>
      <ul>{itemTypes}</ul>
    </div>
  );
}

export default Pokemon;
